"use strict";window.addEventListener("load",(()=>{async function fetchLoad(url){document.querySelector("#JS-content-index").innerHTML="Loading...";const fetchRequest=await fetch(url);!function(html){const newElement=document.createElement("div");newElement.innerHTML=html;const oldContent=document.querySelector("#JS-content-index"),newContent=newElement.querySelector("#JS-content-index");oldContent.innerHTML=newContent.innerHTML}(await fetchRequest.text())}document.querySelector("body").addEventListener("click",(event=>{event.target.matches("#JS-content-index #JS-load-index a")&&(event.preventDefault(),fetchLoad(event.target.href),window.history.pushState(null,null,event.target.href))})),window.addEventListener("popstate",(()=>{fetchLoad(window.location.href)}))}));